import React, {Component} from 'react'

class ArticleList extends Component {
    constructor(props){
        super(props)
        this.state = {article: this.props.article}
      }
    render(){
        return(
            this.state.article.map(el => (
                <li>
                  {el.title}
                </li>
              ))
        )
    } 
}





export default ArticleList
